class User:
    def __init__(self, username, user_type):
        self.username = username
        self.user_type = user_type

class FileGenerator:
    def __init__(self):
        self.errors = []

    def validate_submission(self, submission):
        self.errors.clear()
        if not submission.get('data'):
            self.errors.append("Data cannot be empty.")
        if submission.get('status') not in ['valid', 'invalid']:
            self.errors.append("Invalid status.")
        return len(self.errors) == 0

    def generate_file(self, submission):
        if self.validate_submission(submission):
            print(f"Generating file for submission: {submission}")
            return True
        else:
            self.update_error_messages()
            return False

    def update_error_messages(self):
        for error in self.errors:
            print(f"Error: {error}")

class FABSValidator:
    def validate(self, fabs_data):
        if 'amount' not in fabs_data or fabs_data['amount'] <= 0:
            print("FABS data validation failed: Amount must be greater than 0.")
            return False
        # Additional validation can be added here
        print("FABS data is valid.")
        return True

